import './playlistDetail.css';

const PlayCoPlaylistDetail = () => {
  return <div>
    <div>
      <input type="checkbox">재생목록 공개</input>
      <h1>재생 목록</h1>
      <input>목록에 추가 할 YouTube 링크</input>
      <div>목록 아이템들</div>
    </div>
    <div>
      <h1>플레이어</h1>
    </div>
  </div>;
};

export { PlayCoPlaylistDetail };
